import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import NavBar from "./NavBar";
import "./Custom.css";
import pic1 from "./assets/images/home/DSC_4848-2.jpg";
import pic2 from "./assets/images/feed/IMG_3407.jpg";
import { makePics, threeCols } from "./functions/createRows";
import Images2016 from "./assets/images/feed/Images2016";

export default function HomePage() {
  return (
    <div>
      <div className="container">
        <NavBar />
        <h3 className="text-center text-muted">2020</h3>

        <div className="row row-sm-1 row-md-2 row-lg-3">
          {" "}
          {/* pano: 2/3 left, 1/3 right*/}
          <div className="col-md-8 bg-info p-md-2 text-center">1 of 2</div>
          <div className="col-md-4 bg-dark p-md-2 text-center">2 of 2</div>
        </div>
        <div className="row row-sm-1 row-md-2 row-lg-3">
          {" "}
          {/* pano: 1/3 left, 2/3 right*/}
          <div className="col-md-4 bg-dark p-md-2 text-center">1 of 2</div>
          <div className="col-md-8 bg-success p-md-2 text-center">2 of 2</div>
        </div>
        <div className="row">
          {" "}
          {/* pano: entire width*/}
          <div className="col bg-warning p-md-2 text-center">1 of 1</div>
        </div>

        <h3 className="text-center text-muted">2019</h3>
        <h3 className="text-center text-muted">2018</h3>
        <h3 className="text-center text-muted">2017</h3>
        <h3 className="text-center text-muted">2016</h3>
        {threeCols(Images2016, 0, 23)}
      </div>
      <Footer />
    </div>
  );
}
